import React from 'react';

function Results() {
  return (
    <section>
      <h2>KẾT QUẢ KHÁCH HÀNG</h2>
      <div style={{ display: 'flex', flexWrap: 'wrap', justifyContent: 'center', gap: 16, margin: '32px 0' }}>
        {[1,2,3,4,5,6,7,8].map(i => (
          <div key={i} style={{ width: 90, height: 120, background: '#222', borderRadius: 8, overflow: 'hidden' }}>
            <img src={`/result${i}.jpg`} alt={`Result ${i}`} style={{ width: '100%', height: '100%', objectFit: 'cover' }} onError={e => {e.target.style.display='none'}} />
            <div style={{ color: '#fff', fontSize: 12 }}>text</div>
          </div>
        ))}
      </div>
      <div style={{ color: '#c8102e', fontWeight: 700, margin: 16 }}>TÌM CÂU LẠC BỘ GẦN BẠN NHẤT NGAY BÂY GIỜ</div>
      <button className="btn">THAM GIA NGAY</button>
    </section>
  );
}

export default Results;
